  return (
    <>
      <div className="row">
        <div className="col-2">
          <img src="./logo192.png" alt="company logo" />
        </div>

        <div className="col align-self-center text-start">
          <h1>{saying}</h1>
        </div>
      </div>
    </>
  );
}

